const productList = document.getElementById("product-list");
const searchInput = document.getElementById("search");
const categoryFilter = document.getElementById("category-filter");
const priceFilter = document.getElementById("price-filter");
const cartCount = document.getElementById("cart-count");
let cart = 0;

// function to display products
function displayProducts(items) {
    productList.innerHTML = "";
    items.forEach(product => {
        const div = document.createElement("div");
        div.classList.add("product");
        div.innerHTML = `
      <img src="${product.image}" alt="${product.name}">
      <h3>${product.name}</h3>
      <p>Category: ${product.category}</p>
      <p>Price: $${product.price}</p>
      <button>Add to Cart</button>
    `;
        div.querySelector("button").addEventListener("click", () => {
            cart++;
            cartCount.textContent = cart;
        });
        productList.appendChild(div);
    });
}

// filter function
function filterProducts() {
    const searchText = searchInput.value.toLowerCase();
    const category = categoryFilter.value;
    const priceValue = priceFilter.value;

    const filtered = products.filter(p => {
        const matchName = p.name.toLowerCase().includes(searchText);
        const matchCategory = category === "all" || p.category === category;
        const matchPrice = priceValue === "all" || p.price <= parseInt(priceValue);
        return matchName && matchCategory && matchPrice;
    });

    displayProducts(filtered);
}

searchInput.addEventListener("input", filterProducts);
categoryFilter.addEventListener("change", filterProducts);
priceFilter.addEventListener("change", filterProducts);

// initial load
displayProducts(products);


// Soo xulo badhanka
const backToTop = document.getElementById('backToTop');

// Marka la scroll gareeyo
window.addEventListener('scroll', () => {
    if (window.scrollY > 200) {
        backToTop.style.display = 'block';   // muuji
    } else {
        backToTop.style.display = 'none';    // qari
    }
});

// Marka la dhufanayo badhanka
backToTop.addEventListener('click', () => {
    window.scrollTo({ top: 0, behavior: 'smooth' });  // si tartiib ah kor ugu laabo
});